import React,{Component} from 'react';
import {BrowserRouter as Router,Route,Switch} from 'react-router-dom';
import Java from './Java.js';
import Python from './Python.js';
import PythonDeatil from './PythonDeatil.js';
import JavaScript from './JavaScript.js';
import Navigation from './Navigation.js';
import Home from './Home.js';
import './App.css';
class App extends Component {
  constructor(){
    super()
    this.state = {
      languages:[
        {id:11,name:'hello python'},
        {id:22,name:'hello js'},
        {id:33,name:'helo java'}
      ]
    }
  }
  render(){
    return(
      <div>

        <Router>
          <Navigation/>
          <Switch>
            <Route exact path = '/' render  = {() => <Home/>}/>
            <Route path = '/Java' render = { ()=> <Java />}/>
            <Route path = '/JavaScript'render  = { ()=> <JavaScript />}/>
            <Route path = '/Python/:id' render = { (props)=>{
              let myId = props.match.params.id;
              let python;
              this.state.languages.forEach(language => {
                if(language.id===Number(myId)){
                  python = language;
                }

              })


              return (<Python  pythonElement = {python}/>)
            } }/>
          </Switch>
        </Router>
      </div>
    )
  }
}
export default App;
